export class PolygonDrawerBase{draw(t,e,n,o){const a=this.getCenter(e,n),r=this.getSidesData(e,n),s=r.count.numerator*r.count.denominator,i=r.count.numerator/r.count.denominator,l=180*(i-2)/i,h=Math.PI-Math.PI*l/180;if(t){t.beginPath(),t.translate(a.x,a.y),t.moveTo(0,0);for(let e=0;e<s;e++)t.lineTo(r.length,0),t.translate(r.length,0),t.rotate(h)}}};